import { createI18n } from 'react-router-i18n';
import translationEN from "./locales/en.json";
import translationES from "./locales/es.json";

const locales = ['en', 'es'];


const translations = {
  en: {
    translation: translationEN,
  },
  es: {
    translation: translationES,
  }
}

const I18n = createI18n(
  locales,
  translations,
);

export default I18n;
